import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import './App.css';
import { CitiesProvider } from './contexts/CitiesContext';
import { AuthProvider } from './contexts/AuthContext';
import AppLayout from './components/AppLayout';
import CityList from './components/CityList';
import City from "./components/City";
import Form from './components/Form';
import { Suspense, lazy, useEffect, useState } from 'react';
import CountriesList from './components/CountriesList';
import SpinnerFullPage from "./components/SpinnerFullPage";

const Homepage = lazy(()=>import("./pages/Homepage"));
const Product = lazy(()=>import("./pages/Product"));
const Login = lazy = (()=>import("./pages/Login"));
const PageNotFound = lazy(()=>import("./pages/PageNotFound"));
const Pricing = lazy(()=>import("./pages/Pricing"));




function App() {
  return (
    <AuthProvider>
    <CitiesProvider>
<BrowserRouter>
<Suspense fallback={<SpinnerFullPage></SpinnerFullPage>}>
<Routes>
  <Route path = "/" element={<Homepage></Homepage>}></Route>
  <Route path = "/product" element={<Pricing></Pricing>}></Route>
  <Route path = "/pricing" element={<Product></Product>}></Route>
  <Route path = "/login" element = {<Login></Login>}></Route>
  <Route path = "/app" element = {<AppLayout></AppLayout>}>
    <Route index element = {<Navigate replace to ="cities" />}></Route>
    <Route path = "cities" element = {<CityList></CityList>}></Route>
    <Route path = "cities/:id" element = {<City></City>}></Route>
    <Route path = "countries" element = {<CountriesList></CountriesList>} ></Route>
    <Route path = "form" element = {<Form></Form>}></Route>
  </Route>
  <Route path="*" element = {<PageNotFound></PageNotFound>}></Route>
</Routes>
</Suspense>
</BrowserRouter>
</CitiesProvider>
</AuthProvider>
  )
}

export default App
